    $scope.findTruckDetails = function(id) {
        $scope.data.entroImp = "entró e imprimió el siguiente mensaje :V"
        if (id !== undefined) {
            $ionicLoading.show({
                template: '<div class="loader"><svg class="circular"><circle class="path" cx="50" cy="50" r="20" fill="none" stroke-width="2" stroke-miterlimit="10"/></svg></div>',
                content: 'Cargando',
                animation: 'fade-in',
                showBackdrop: true,
                maxWidth: 200,
                showDelay: 0
            });

            var DataPromise = Data.truckDetailsInspection($rootScope.urlCustomer, id)
            DataPromise.then(function(result) {
                if (result) {
                    $scope.data.truckDetails = result['details'];
                    $scope.data.truckUnidad = result['unidad'];
                    $scope.data.truckTipo = result['tipo'];
                    $scope.data.truckRend = result['truckRend'];                              
                    $scope.tirePrice = 5000;
                    $ionicLoading.hide();
                    $scope.data.meses = [
                            '',
                            $translate.instant('REPORTS_ENERO'),
                            $translate.instant('REPORTS_FEBRERO'),
                            $translate.instant('REPORTS_MARZO'),
                            $translate.instant('REPORTS_ABRIL'),
                            $translate.instant('REPORTS_MAYO'),
                            $translate.instant('REPORTS_JUNIO'),
                            $translate.instant('REPORTS_JULIO'),
                            $translate.instant('REPORTS_AGOSTO'),
                            $translate.instant('REPORTS_SEPTIEMBRE'),
                            $translate.instant('REPORTS_OCTUBRE'),
                            $translate.instant('REPORTS_NOVIEMBRE'),
                            $translate.instant('REPORTS_DICIEMBRE')
                        ];


                    $ionicHistory.clearCache().then(function() {
                        $state.go('app.detallesCamion');
                    });
                } else {
                    $ionicLoading.hide();
                    $ionicPopup.alert({
                        title: '¡Error!',
                        template: '<center><p><b>¡Los datos de esta unidad no han sido cargados!</b></p></center>',
                        okText: 'Aceptar',
                        okType: 'button-assertive'
                    });
                }

            }, function(reason) {
                $ionicLoading.hide();
                $ionicPopup.alert({
                    title: '¡Error!',
                    template: '<center><p>Error de conexión<br/><b> Por favor inténtelo de nuevo</b></p></center>',
                    okText: 'Aceptar',
                    okType: 'button-assertive'
                });
            })
            .finally(function() {
                // Stop the ion-refresher from spinning
                $scope.$broadcast('scroll.refreshComplete');
            });
        }
    }

