                        $scope.llantasRevision = $scope.generalInfo.llantas;
                        $scope.unidadesRevision = $scope.generalInfo.unidades;
                        $scope.rendMarcas = []

                        var DataPromise = Data.getRendByFleet($rootScope.urlCustomer, $localStorage.idSemaforos)
