    $scope.generateSemaphore = function(){
        $scope.onDeviceReady;
        $ionicModal.fromTemplateUrl('pdf-viewer', {
        scope: $scope,
        animation: 'slide-in-up'
        }).then(function (modal) {
            vm.modal = modal;
        });

        $scope.fileName = "ReporteSemaforo";
        $scope.greenSemaphore = "data:image/png;base64,"
        $scope.yellowSemaphore = "data:image/png;base64,"
        $scope.redSemaphore = "data:image/png;base64,"
        $scope.whiteSemaphore= "data:image/png;base64,"
        var green = $scope.greenSemaphore;
        var yellow = $scope.yellowSemaphore;
        var red = $scope.redSemaphore;
        var white = $scope.whiteSemaphore;
        var tiresGreen = $scope.verde;
        var tiresYellow = $scope.amarillo;
        var tiresRed = $scope.rojo;
        var tiresWhite = $scope.blanco;

        var documentDefination = {
        pageSize: 'LEGAL',
          pageOrientation: 'portrait',
          pageMargins: [40, 140, 40, 120],
          header: {
              margin: 8,
              columns: [
                  {
                      table: {
                          widths: [ '50%','50%'],
                          body: [
                              [
                                  { image: 'data:image/jpeg;base64,',
                                    width: 595, height: 120,                                
                                  },
                                 
                              ]
                          ]
                      },
                      layout: 'noBorders'
                  }
              ]
          },
          content : [   
                        {text:'\n\n', margin : [ 50, 0, 0, 0 ],  width : 100,}, 
                        {text:'Estatus Actual de las Llantas Inspeccionadas', style: 'centerme', },
                         {text:'\n\n', margin : [ 100, 0, 0, 0 ],  width : 100,}, 
                        {
                            layout: 'lightHorizontalLines', // optional
                            table: { 
                                headerRows: 1,
                                widths: [ '*', '*', '*'],
                                body: [
                                    [ 'Semaphore', 'Description', 'Tires'],
                                    [{image: green, width: 100, height: 100, style: 'leftme',} , {text:'Semaforo Verde', style: 'centerme', }, {text: tiresGreen, style: 'centerme',}],
                                    [{image: yellow, width: 100, height: 100, style: 'leftme',} , {text:'Semaforo Amarillo', style: 'centerme',}, {text: tiresYellow, style: 'centerme',}],  
                                    [{image: red, width: 100, height: 100, style: 'leftme',} , {text:'Semaforo Rojo', style: 'centerme',}, {text: tiresRed, style: 'centerme',}],
                                    [{image: white, width: 100, height: 100, style: 'leftme',} , {text:'Semaforo Blanco', style: 'centerme',}, {text: tiresWhite, style: 'centerme',}]   
                                 ]       
                            },
                        },   

                        {text:'\n\n', margin : [ 100, 0, 0, 0 ],  width : 100, },
                        

          ],
          columns: [{text:'\n\n', margin : [ 30, 0, 0, 0 ],  width : 100,} ],
          
                    styles: {
                        header: {
                            fontSize: 20,
                            bold: true,
                            margin: [0, 0, 0, 5],
                            alignment: 'right'
                        },
                        subheader: {
                            fontSize: 15,
                            bold: true,
                            margin: [0, 0, 0, 5]
                        },
                        itemsTable: {
                            margin: [0, 5, 0, 10]
                        },
                        itemsTableHeader: {
                            bold: true,
                            fontSize: 15,
                            color: 'black',
                            align: 'center'
                        },
                        totalsTable: {
                            bold: true,
                            margin: [0, 10, 0, 0]
                        },
                        finalTotalTable:{
                          bold: true,
                          fontSize:15,
                            margin: [0, 20, 0, 0] 
                        },
                        personalDetails:{
                          bold: true,
                          fontSize:10,
                          margin: [0, 0, 0, 5]
                        },
                        centerme:{   
                              alignment: 'center',
                              fontSize: 20,
                              bold: true
                        },
                        leftme:{   
                              alignment: 'left',
                              fontSize: 20,
                              bold: true
                        }
                    }
        };

        //Creating PDF in Base64
        pdfMake.createPdf(documentDefination).getBase64(function(base64){
            pdf = atob(base64);       
            var arr = new Array(pdf.length);
            for(var i = 0; i < pdf.length; i++) {
              arr[i] = pdf.charCodeAt(i);
          }
          var byteArray = new Uint8Array(arr);      
          var blob = new Blob([byteArray], {type: 'application/pdf'});
          $scope.pdfUrl = URL.createObjectURL(blob);
                    
          //writing file on device        
          var folderpath = cordova.file.externalRootDirectory;
          var filename = $scope.fileName+".pdf";

          window.resolveLocalFileSystemURL(folderpath, function(dir) {
              console.log("Access to the directory granted succesfully");
              dir.getFile(filename, {create:true}, function(file) {
                      console.log("File created succesfully.");
                      file.createWriter(function(fileWriter) {
                          console.log("Writing content to file");
                          fileWriter.write(blob);
                      }, function(){
                          alert('Unable to save file in path '+ folderpath);
                      });
              });
          });

          //Opening created pdf file into default file opener (Acrobat for PDF)
          $cordovaFileOpener2.open(folderpath+filename,'application/pdf')
            .then(function() {
              console.log('Success');
            }, function(err) {
            console.log('An error occurred: ' + JSON.stringify(err));
          });

        });
    }

