    $scope.runGeneralReport = function(){
        var defered = $q.defer();
        var promise = defered.promise;        
        $scope.loadUnidadesStatus();
        $scope.loadSemaforos();
        $scope.onDeviceReady;
        $ionicModal.fromTemplateUrl('pdf-viewer', {
        scope: $scope,
        animation: 'slide-in-up'
        }).then(function (modal) {
            vm.modal = modal;
        });

        function getData() {
            var defered = $q.defer();
            var promise = defered.promise;            
            $scope.fileName = "ReporteGeneral";
            $timeout(function() {
                try {
                    var resultado = 1 + 2;
                    defered.notify(100);
                    defered.resolve(resultado);
                } catch (e) {
                    defered.reject(e);
                }
            }, 5000);            
            return promise;
                      
        }

        $scope.mensaje = "Esperando a que se resuelva la promesa"
        var promise = getData();
        promise.then(function(resultado) {
            $scope.mensaje = "El resultado de la promesa es:" + resultado;
        }, function(error) {
                $scope.mensaje = "Se ha producido un error al obtener el dato:" + error;
        }, function(progreso) {
                $scope.progreso = progreso+"%";
                console.log($scope.progreso)
        });    
        promise["finally"](function() { 
            $scope.storageLists = StorageService.getList();           
            $scope.printFile($scope.fileName);  
            alert("Mensaje del ejemplo.Esto se llama justo antes de resolver o rechazar la promesa." + resultado);               

            });

        
          
    }

